        [Fact]
        public void WFiltro_Tribunal_end_QuandoTemAmbosValores_DeveUsarOperadorBETWEEN()
        {
            // Arrange
            var valorTribunalInicial = 1000;
            var valorTribunalFinal = 5000;
            var filtro = new FilterTribEnderecos
            {
                Tribunal = valorTribunalInicial,
                Tribunal_end = valorTribunalFinal,
                LogicalOperator = " AND "
            };
            // Act
            var resultado = _service.WFiltro(filtro);
            // Assert
            resultado.Should().NotBeNull();
            // Deve usar operador BETWEEN
            resultado.Value.where.Should().Contain($"[{DBTribEnderecosDicInfo.PTabelaNome}].{DBTribEnderecosDicInfo.Tribunal} BETWEEN @{DBTribEnderecosDicInfo.Tribunal} AND @{DBTribEnderecosDicInfo.Tribunal}_end");
            resultado.Value.where.Should().NotContain(" = ");
            // Deve ter exatamente 2 parâmetros
            resultado.Value.parametros.Should().HaveCount(2);
            // Verifica os parâmetros específicos
            var parametroInicial = resultado.Value.parametros.FirstOrDefault(p => p.ParameterName == $"@{DBTribEnderecosDicInfo.Tribunal}");
            var parametroFinal = resultado.Value.parametros.FirstOrDefault(p => p.ParameterName == $"@{DBTribEnderecosDicInfo.Tribunal}_end");
            parametroInicial.Should().NotBeNull();
